import React from 'react';

function Form(props) {
    return (
        <div className="form">
            <input
                placeholder='Ведите текст'
                type="text"
                value={props.text}
                onChange={(e) => setText(e.target.value)}
            />
            <button onClick={props.addTodo}>Добавить</button>
        </div>
    );
}

export default Form;
